import React from 'react';
import users from './../assets/images/group.svg';
import undo from './../assets/images/left.svg';
import redo from './../assets/images/right.svg';
import save from './../assets/images/diskette.svg';
import './../styles/header.scss';

const Header = () => {
    return (
        <div className="header">
            <div className="header__inner">
                <div className="header__left">Paint</div>
                <div className="header__middle">
                    <img src={users} className="header__users"/>
                    <div className="header__title">No name</div>
                </div>
                <div className="header__right">
                    <img src={undo} className="header__undo"/>
                    <img src={redo} className="header__redo"/>
                    <img src={save} className="header__save"/>
                </div>
            </div>
        </div>
    );
};

export default Header;
